import React, {Component} from 'react';
import _ from 'lodash';
import './Sql-injection.css';

class SqlInjection extends Component {
  render() {
    var classes = ['sql-injection-container', this.props.isActive ? 'active' : ''];

    return (
      <div className={_.join(classes, ' ')}>
        <div className='sql-injection-bad'>
          <input className='sql-injection-bad-input' type='text'></input>
          <button className='sql-injection-bad-btn'></button>
        </div>
        <div className='sql-injection-good'>
          <input className='sql-injection-good-input' type='text'></input>
          <button className='sql-injection-good-btn'></button>
        </div>
      </div>
    );
  }
}

export default SqlInjection;
